import { Button, Table } from "antd";
import axios from "axios";
import { useEffect, useState } from "react";
import url from "../components/host";
import { AiOutlineCheck, AiOutlineClose } from "react-icons/ai";
import "./style/style.css";
const CarHistory = () => {
  const [data, setdata] = useState([]);
  const [data1, setdata1] = useState([]);
  const [page, setPage] = useState(1);
  const [id, setId] = useState('');
  const [timeCreate, setTimeCreate] = useState('');
  const [visitTime, setVisitTime] = useState('');
  const [isActive, setIsactive] = useState('');
  const [user, setUser] = useState('');
  const [car, setCar] = useState('');
  const [branch, setBranch] = useState('');
  const columns = [
    {
      title: "Id",
      dataIndex: "id",
    },
    {
      title: "user",
      render: (_,item)=> <div>{item.user.username}</div>
    },
    {
      title: "car",
      render: (_,item)=> <div>{item.car.name}</div>
    },
    {
        title: "branch",
        render: (_,item)=> <div>{item.branch.name}</div>
      },
      {
        title: "time_create",
        render: (_,item)=> <div>{item.time_create.slice(0,10)}</div>
      },
      {
        title: "visit_time",
        dataIndex: "visit_time",
      },
    {
      title: "Status",
      dataIndex: "is_active",
      render: (el) => (
        <div className="status">
          {el ? (
            <h1 style={{ color: "green" }}>
              <AiOutlineCheck />
            </h1>
          ) : (
            <h1 style={{ color: "red" }}>
              <AiOutlineClose className="AiOutlineClose" />
            </h1>
          )}
        </div>
      ),
    },
    {
      title: "Ma'lumot",
      key: "edit",
      width: "5%",
      render: (__, item) => {
        return (
          <div>
            <Button
              onClick={() => {
                getOneProduct(item);
              }}
              style={{ background: "orange", color: "white" }}
              type="text"
            >
              Ma'lumot
            </Button>
          </div>
        );
      },
    },
    // {
    //   title: "O'chirish",
    //   key: "O'chirish",
    //   width: "5%",
    //   render: (__, item) => {
    //     return (
    //       <div>
    //         <Button               onClick={() => {
    //             deletecar(item);
    //           }} type="danger">
    //         O'chirish
    //         </Button>
    //       </div>
    //     );
    //   },
    // },
  ];
  const getOneProduct = (item) => {
    console.log(item,"choose");
    // setdata(item);
    // setYear(item.year)
    // setDistance(item.distance)
    // setEngine(item.engine)
    setId(item.id)
    setCar(item.car.name)
    setUser(item.user.username)
    setBranch(item.branch.name)
    setTimeCreate(item.time_create)
    setVisitTime(item.visit_time.slice(0,10))
    setPage(2);
    //     axios.get(`${url}/api/position_get/${item.position}/`).then((res) => {
    //         setPosition(res.data.name)
    //         setSeries(res.data.series.name)
    //         setModel(res.data.series.model.name)
    //         axios.get(`${url}/api/fuel_sort/${item.fuel_sort}/`).then((res2) => {   
    //             setFuelSort(res2.data.name)
    //             axios.get(`${url}/api/gear_box/${item.gearbox}/`).then((res3) => {   
    //                 setGearbox(res3.data.name)
    //                 axios.get(`${url}/api/garant/${item.garant}/`).then((res4) => {   
    //                     setGarant(res4.data.time)
    //                     axios.get(`${url}/api/branch/${item.branch}/`).then((res5) => {   
    //                         setBranch(res5.data.name)
    //                       });
    //                   });
    //               });
    //           });
    //       });
  };
// function deletecar (car) {
//     console.log(car);
//     axios.delete(`${url}/api/car_history/${car.id}/`,
//      {
//         headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
//       }
//       ).then((res2) => {
//         axios.get(`${url}/api/car_history/`).then((res) => {
//             setdata1(res.data);
//           });

//       });
// }
  function getData() {
    axios.get(`${url}/api/order_get/`,     {
        headers: { Authorization: "Bearer " + sessionStorage.getItem("token") },
      }).then((res) => {
      setdata1(res.data);
      console.log(res.data,'DATA');
    });
  }
  useEffect(() => {
    getData();
  }, []);
  return (
    <div>
      {page == 1 ? (
        <div>
          <Table className="table1" columns={columns} dataSource={data1} />
        </div>
      ) : (
        <div>
          <div className="nomi1">
            <h1 className="nomi">{data.name}</h1>
            <div
              style={{
                width: "200px",
                display: "flex",
                justifyContent: "space-around",
              }}
            >
              <Button onClick={() => setPage(1)} type="danger">
                Orqaga
              </Button>
            </div>
          </div>
          <div className="alltext">
            <div className="alltext2">
              <div className="alltext1">
                <div className="text1">
                  <div className="text">
                    <h1>ID</h1>
                    <input value={id}  className="slect" type="text" />
                  </div>
                  <div className="text">
                    <h1>user</h1>
                    <input value={user}  className="slect" type="text" />
                  </div>
                  <div className="text">
                    <h1>car</h1>
                    <input value={car}  className="slect" type="text" />
                  </div>
                  <div className="text">
                    <h1>branch</h1>
                    <input value={branch}  className="slect" type="text" />
                  </div>
                  <div className="text">
                    <h1>visit_time</h1>
                    <input value={visitTime}  className="slect" type="text" />
                  </div>
                  <div className="text">
                    <h1>time_create</h1>
                    <input value={timeCreate}  className="slect" type="text" />
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      )}

    </div>
  );
};
export default CarHistory;
